import React from "react";
import Link from "next/link";

const Footer = () => {
  return (
    <footer className="main-footer">
      <div className="inner-footer">
        <div className="links">
          <h4>Links</h4>
          <ul>
            <li>
              <Link href="/">
                <a>Home</a>
              </Link>
            </li>
            <li>
              <Link href="/profile">
                <a>Profile</a>
              </Link>
            </li>
          </ul>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
